def vowels_count(s):
    """Write a function vowels_count which takes a string representing
    a word as input and returns the number of vowels in the string.
    Vowels in this case are 'a', 'e', 'i', 'o', 'u'. Here, 'y' is also a
    vowel, but only when it is at the end of the given word.

    Example:
    >>> vowels_count("abcde")
    2
    >>> vowels_count("ACEDY")
    3
    """

    def count_occurences(word, char):
        occurrences = 0
        for char in word:
            if char == char:
                occurrences += 1
        return occurrences

    def is_letter(char):
        if char.isalpha():
            return char
        else:
            return None

    def is_vowel(char):
        if char.isalpha():
            if char in 'aeiouyAEIOUY':
                return char
            else:
                return None
        else:
            return None

    vowels = []
    word = ""
    for char in s:
        if is_vowel(char):
            vowels.append(char)
        else:
            word += char
    vowels_count = 0
    for char in vowels:
        if is_letter(char):
            vowels_count += 1
    return vowels_count
